import React from 'react';
import Button from '@mui/material/Button';
import SettingsOutlinedIcon from '@mui/icons-material/SettingsOutlined';
import DarkModeOutlinedIcon from '@mui/icons-material/DarkModeOutlined';
import LightModeOutlinedIcon from '@mui/icons-material/LightModeOutlined';

function Navbar() {
  return (
    <nav class="nav-bar">
      <div class="nav-bar-left">
        <Button class="nav-bar-button-left">Home</Button>
        <Button class="nav-bar-button-left">Favourites</Button>
      </div>
      <div class="nav-bar-right">
        <Button class="nav-bar-button-right" variant="outlined">{DarkModeOutlinedIcon && <DarkModeOutlinedIcon type={DarkModeOutlinedIcon}/>}</Button>
        <Button class="nav-bar-button-right" variant="outlined">{SettingsOutlinedIcon && <SettingsOutlinedIcon type={SettingsOutlinedIcon}/>}</Button>
      </div>
    </nav>
  );
}

export default Navbar;
